import React, { Component } from 'react'

export default class Navbar extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-dark bg-primary">
                    <h3>Number of cards</h3>
                    <span class="badge badge-secondary">New</span>
                </nav>
            </div>
        )
    }
}
